import React from 'react';
import Plan from './plan.svg';
import "./svg.css"

const App = () => {
  return (
    <div className="Plan">
      <div class="row justify-content-center">
      <img src={Plan} alt="Map"></img> 
      </div>
    </div>
  );
}
export default App;
